import React from "react";
import "../../styles/CurrentOpenings.css";

function CurrentOpenings() {
  return (
    <div className="co-container">
      {/* Animated Background */}
      <div className="cloud cloud1"></div>
      <div className="cloud cloud2"></div>
      <div className="cloud cloud3"></div>

      <div className="road"></div>

      {/* Trucks */}
      <div className="truck truck1"></div>
      <div className="truck truck2"></div>
      <div className="truck truck3"></div>

      {/* Main Message */}
      <div className="co-message">
        <h1>Current Openings</h1>
        <p>We are working on this page, sorry for inconvenience, thanks for visiting. Explore other options!</p>
      </div>
    </div>
  );
}

export default CurrentOpenings;
